import React from "react"

const LandingPage = () => {
    return (
      <div className="flex flex-col h-screen items-center justify-center bg-blue-500 text-white text-4xl font-bold shadow-lg rounded-lg">
        <h2 className='underline'>The Movie Network</h2>
        <p className="text-lg">Delivering the latest news in cinema to you!</p>
        <button className="mt-auto text-lg bg-white text-blue-500 py-2 px-4 rounded-md shadow-md hover:bg-blue-500 hover:text-white">
          Create Account
        </button>
      </div>
    );
};

export default LandingPage;
